import React from 'react';

const menuItems = [
    {
      name: 'Ofertas',
    },
    {
      name: 'Mis compras',
    },
];

const NavBar = () => {
    return (
        <div className="flex flex-row justify-around p-4 w-full">
            
           <ul className="flex flex-row justify-around p-4 w-full">
              {menuItems.map(item => (
                <li>
                  <a>{item.name}</a>
                </li>
              ))}
            </ul> 
        </div>
    );
}

export default NavBar;
